import React from 'react';
import { Link } from 'react-router-dom';
import store from '../../store';

// import store from '../../store';

const guestMenu = '<li><Link to="/login">Login</Link></li><li><Link to="/register">Register</Link></li>';
const authMenu = '<li><Link to="/logout">Logout</Link></li><li><Link to="/dashboard">Dashboard</Link></li>';

class Menu extends React.Component {

  constructor(props)
  {
    super(props)
    this.state = {
      login: store.getState().login
    }
  }


  render() {
    return (
      <div className="Menu">
            <ul>
              <li >
                <Link to="/">Home</Link>
              </li>
              <li>
                <Link to="/login">Login</Link>
              </li>
              <li>
                <Link to="/logout">Logout</Link>
              </li>
              <li>
                <Link to="/register">Register</Link>
              </li>
              <li>
                <Link to="/dashboard">Dashboard</Link>
              </li>
            </ul>
      </div>
    )
  }
}

export default Menu;
